import React from 'react';
import { View, Text } from 'react-native';
import Cadastro from '../components/Cadastro';

const CadastroScreen = () => {
  return (
    <View>
      <Text>Cadastro</Text>
      <Cadastro />
    </View>
  );
};

export default CadastroScreen;
